import { slide as BurgerMenu } from 'react-burger-menu';
import { useRef } from 'react';
import React, { Component } from 'react';

const BurgerMenuComposant = () => {
    const main_container = useRef(null);
    const handleClick = () => {
        main_container.current?.scrollIntoView({ behavior: 'smooth' });
    };
    return (
        <div className="nav">
            <BurgerMenu right className="menu-fixed">
                <button className="menu-item">Accueil</button>
                <button className="menu-item">Services</button>
                <button to="/contact" className="menu-item">Contact</button>
            </BurgerMenu>
        </div>
    );
};

export default BurgerMenuComposant
